import React from "react";
import classes from "./Preview.module.scss";
import avatar from "../../img/icons.svg#icon-user";

const PreviewResult = (props) => {
  return (
    <li className={classes.preview}>
      <a className={classes.preview__link} href="#23456">
        <figure className={classes.preview__fig}>
          <img src={props.img} alt="Test" />
        </figure>
        <div className={classes.preview__data}>
          <h4 className={classes.preview__title}>{props.title}</h4>
          <p className={classes.preview__publisher}>{props.publisher}</p>
          <div className={classes.preview__user__generated}>
            <svg>
              <use href={avatar}></use>
            </svg>
          </div>
        </div>
      </a>
    </li>
  );
};

export default PreviewResult;
